      Director    :   Srikanth Velagaleti       
      Writer      :   Saurabh Shukla            


      Genre       :   Comedy | Thriller         


UTT PATAANG is a comedy thriller of happenings  
of one night that finds a simpleton Vinay Pathak
who is on the brink of a break up, caught in a  
dangerous money deal gone horribly wrong.       
Caught in this chase for the bagful of money,   
is his private detective friend Saurabh Shukla, 
a heartbroken woman a French-obsessed gangster  
and the gangster's moll , all thrown into  a    
dangerous game of cat-and-mouse chase.          
Layers of secrecy unfold and game gets worse    
as the night wears on.                          

